INSERT INTO `sdb_b2c_comment_goods_type` VALUES ('1', '描述相符', 'a:2:{s:14:\"is_total_point\";s:2:\"on\";s:11:\"description\";a:5:{i:5;s:63:\"质量非常好，与卖家描述的完全一致，非常满意\";i:4;s:66:\"质量不错，与卖家描述的基本一致，还是挺满意的\";i:3;s:45:\"质量一般，没有卖家描述的那么好\";i:2;s:54:\"部分有破损，与卖家描述的不符，不满意\";i:1;s:63:\"差的太离谱，与卖家描述的严重不符，非常不满\";}}');
INSERT INTO `sdb_b2c_comment_goods_type` VALUES ('2', '服务态度', 'a:2:{s:14:\"is_total_point\";s:3:\"off\";s:11:\"description\";a:5:{i:5;s:69:\"卖家的服务太棒了，考虑非常周到，完全超出期望值\";i:4;s:57:\"卖家服务挺好的，沟通挺顺畅的，总体满意\";i:3;s:57:\"卖家回复很慢，态度一般，谈不上沟通顺畅\";i:2;s:54:\"卖家有点不耐烦，承诺的服务也兑现不了\";i:1;s:72:\"卖家态度很差，还骂人、说脏话，简直不把顾客当回事\";}}');
INSERT INTO `sdb_b2c_comment_goods_type` VALUES ('3', '发货速度', 'a:2:{s:14:\"is_total_point\";s:3:\"off\";s:11:\"description\";a:5:{i:5;s:57:\"卖家发货速度非常快，包装非常仔细、严实\";i:4;s:48:\"卖家发货挺及时的，运费收取很合理\";i:3;s:48:\"卖家发货速度一般，提醒后才发货的\";i:2;s:54:\"卖家发货有点慢的，催了几次终于发货了\";i:1;s:75:\"再三提醒下，卖家才发货，耽误我的时间，包装也很马虎\";}}');
