INSERT INTO `sdb_content_article_bodys` VALUES ('18', '35', '0', '<div style=\"background-color: rgb(255, 255, 255); padding-top: 0px; padding-right: 0px; padding-bottom: 0px; padding-left: 0px; margin-top: 0px; margin-right: 0px; margin-bottom: 0px; margin-left: 0px; cursor: text; width: 100%; height: 100%; overflow-x: auto; overflow-y: auto; font-family: Arial, Verdana, sans-serif; font-size: 12px; \"><div class=\"pageWrap\"><h2>隐私条款</h2><h4>个人信息</h4>一般情况下，您无须提供您的姓名或其它个人信息即可访问我们的站点。但有时我们可能需要您提供一些信息，例如为了处理订单、与您联系、提供预订服务或处理工作应聘。我们可能需要这些信息完成以上事务的处理或提供更好的服务。<h4>用途</h4><ol>\n	<li>供我们网站交易和沟通等相关方使用，以满足您的订单等购物服务；</li>\n	<li>用于与您保持联系，以开展客户满意度调查、市场研究或某些事务的处理；</li>\n	<li>用于不记名的数据分析（例如点击流量数据）；</li>\n	<li>帮助发展我们的业务关系（如果您是我们网站的业务合作伙伴或批发商）；</li>\n</ol>\n</div></div>', '', '', '', 's:0:\"\";', 's:0:\"\";', '1151', '');
INSERT INTO `sdb_content_article_bodys` VALUES ('19', '36', '0', '<DIV style=\"PADDING-BOTTOM: 0px; OVERFLOW-X: auto; OVERFLOW-Y: auto; BACKGROUND-COLOR: rgb(255,255,255); MARGIN: 0px; PADDING-LEFT: 0px; WIDTH: 100%; PADDING-RIGHT: 0px; FONT-FAMILY: Arial, Verdana, sans-serif; HEIGHT: 100%; FONT-SIZE: 12px; CURSOR: text; PADDING-TOP: 0px\"></DIV>', '', '', '', 's:0:\"\";', 's:0:\"\";', '280', '');
INSERT INTO `sdb_content_article_bodys` VALUES ('20', '37', 'article-help.html', '<div style=\"background-color: rgb(255, 255, 255); padding-top: 0px; padding-right: 0px; padding-bottom: 0px; padding-left: 0px; margin-top: 0px; margin-right: 0px; margin-bottom: 0px; margin-left: 0px; cursor: text; width: 100%; height: 100%; overflow-x: auto; overflow-y: auto; font-family: Arial, Verdana, sans-serif; font-size: 12px; \"><div class=\"pageWrap\"><h2>签收商品时需要注意哪些问题？</h2>1、送货上门、货到付款订单：快递员送货上门时，请您务必当面对照发货单核对商品，如果出现商品数量缺少、商品破损，请您当场办理整单商品的退货。若订单中含有赠品，请一并退回。一旦您确认签字，我们将无法为您办理退换或补发。<ol><strong>特别提示：</strong>\n	<li>如果您的订单使用帐户余额或礼券支付，只有退货商品的金额小于实际应付款金额时才可办理。</li>\n	<li>如果您的订单中含有赠品，将无法提供此项服务；如果是成套商品，您只能整套退货。如果是捆绑商品，您在退主商品的同时需要将赠品一起退回。</li>\n</ol>\n<p>2、邮局邮寄订单：请您在领取包裹时务必检查外包装，如果发现包裹破损，请您不要签收，随后请及时将包裹单原件邮寄给我们，您的包裹单原件将作为我们为您办理补发或退款的唯一证明。收到包裹单后，我们将为您办理相关手续。如您未拆开外包装箱，也可以当场全部退货。平邮订单，在收到包裹时，如发现包裹破损，请您要求邮局出具包裹破损证明。<span style=\"color: rgb(255, 0, 0); \">注：敬请您在验货签收时仔细核对发票，如果出现发票开错或漏开，请您及时联系我们，注明订单号、邮寄地址和收信人姓名，我们接到您的信息后会尽快为您开具，并邮寄给您。</span></p>\n</div></div><p> </p>', '', '', '', 's:0:\"\";', 's:0:\"\";', '1903', null);
