; border-left-style: none; border-width: initial; border-color: initial; background-image: initial; background-attachment: initial; background-origin: initial; background-clip: initial; background-color: rgb(255, 255, 255); background-position: initial initial; background-repeat: initial initial; \">95577</td><th>中信银行</th><td style=\"font-family: Arial, Verdana, sans-serif; font-size: 12px; border-top-style: none; border-right-style: none; border-bottom-style: none; border-left-style: none; border-width: initial; border-color: initial; background-image: initial; background-attachment: initial; background-origin: initial; background-clip: initial; background-color: rgb(255, 255, 255); background-position: initial initial; background-repeat: initial initial; \">86668888</td></tr></tbody></table><h4>2、支付金额上限</h4>目前各银行对于网上支付均有一定金额的限制，由于各银行政策不同，建议您在申请网上支付功能时向银行咨询相关事宜。<h4>3、怎样判断网上支付是否成功？</h4><ol>\n	<li>当您完成网上在线支付过程后，系统应提示支付成功；如果系统没有提示支付失败或成功，您可通过电话、atm 、柜台或登录网上银行等各种方式查询银行卡余额，如果款项已被扣除，网上支付交易应该是成功的，请您耐心等待。</li>\n	<li>如果出现信用卡超额透支、存折余额不足、意外断线等导致支付不成功，请您登录会员中心，找到该张未支付成功的订单，重新完成支付。</li>\n</ol>\n<span style=\"color: rgb(255, 0, 0); \">小贴士：请您在48小时之内完成支付，否则我们将不会保留您的订单。</span><h4>4、造成“支付被拒绝”的原因有哪些？</h4><ol>\n	<li>所持银行卡尚未开通网上在线支付功能</li>\n	<li>所持银行卡已过期、作废、挂失；</li>\n	<li>所持银行卡内余额不足；</li>\n	<li>输入银行卡卡号或密码不符；</li>\n	<li>输入证件号不符；</li>\n	<li>银行系统数据传输出现异常；</li>\n	<li>网络中断。</li>\n</ol>\n</div></div>', '', '', '', 's:0:\"\";', 's:0:\"\";', '10304', null);
INSERT INTO `sdb_content_article_bodys` VALUES ('22', '39', 'article-help.html', '<div style=\"background-color: rgb(255, 255, 255); padding-top: 0px; padding-right: 0px; padding-bottom: 0px; padding-left: 0px; margin-top: 0px; margin-right: 0px; margin-bottom: 0px; margin-left: 0px; cursor: text; width: 100%; height: 100%; overflow-x: auto; overflow-y: auto; font-family: Arial, Verdana, sans-serif; font-size: 12px; \"><div class=\"pageWrap\"><h2>我的订单何时出库？</h2>订单的出库时间要以您订单的配货情况而定。请您随时登录“会员中心”查看订单状态。如果订单显示“已发货”，说明订单已经出库，请您耐心等待收货。</div></div>', '', '', '', 's:0:\"\";', 's:0:\"\";', '616', null);
