5万笔。</td></tr><tr><th><span style=\"text-align: left; \"><label>paypal贝宝</label></span></th><td style=\"font-family: Arial, Verdana, sans-serif; font-size: 12px; border-top-style: none; border-right-style: none; border-bottom-style: none; border-left-style: none; border-width: initial; border-color: initial; background-image: initial; background-attachment: initial; background-origin: initial; background-clip: initial; background-color: rgb(255, 255, 255); background-position: initial initial; background-repeat: initial initial; \">\n<img src=\"http://pic.shopex.cn/pictures/newsimg/1169028114.jpg\"></td><td colspan=\"2\" style=\"font-family: Arial, Verdana, sans-serif; font-size: 12px; border-top-style: none; border-right-style: none; border-bottom-style: none; border-left-style: none; border-width: initial; border-color: initial; background-image: initial; background-attachment: initial; background-origin: initial; background-clip: initial; background-color: rgb(255, 255, 255); background-position: initial initial; background-repeat: initial initial; \">paypal 贝宝（<a href=\"http://www.paypal.com.cn/\"><font color=\"#000000\">www.paypal.com.cn</font></a>）公司是世界领先的网络支付公司paypal 公司为中国市场度身定做的网络支付服务，可以用e-mail地址，透过信用卡及银行帐户，安全地支付及存入网上各类帐项。paypal公司利用现有的银行系统和信用卡系统，通过先进的网络技术和网络安全防范技术，在全球 103 个国家为超过 1 亿个人以及网上商户提供安全便利的网上支付服务。</td></tr></tbody></table></div></div>', '', '', '', 's:0:\"\";', 's:0:\"\";', '15953', null);
INSERT INTO `sdb_content_article_bodys` VALUES ('25', '42', 'article-help.html', '<div style=\"background-color: rgb(255, 255, 255); padding-top: 0px; padding-right: 0px; padding-bottom: 0px; padding-left: 0px; margin-top: 0px; margin-right: 0px; margin-bottom: 0px; margin-left: 0px; cursor: text; width: 100%; height: 100%; overflow-x: auto; overflow-y: auto; font-family: Arial, Verdana, sans-serif; font-size: 12px; \"><div class=\"pageWrap\"><h2>简单的购物流程</h2><h4>怎样注册？</h4><p>答：您可以直接点击\"会员注册\"进行注册。注册很简单，您只需按注册向导的要求输入一些基本信息即可。为了准确地为您服务，请务必在注册时填写您的真实信息，我们会为您保密。输入的帐号要4-10位，仅可使用英文字母、数字\"-\"。</p>\n<h4>怎样成为会员?</h4><p>答：您可以直接点击\"会员登录与注册\"进行注册。注册很简单，您只需根据系统提示输入相关资料即可，请您填写完毕时，务必核对填写内容的准确性，并谨记您的会员账号和密码，以便您查询订单或是希望网站提供予您更多的服务时用以核对您的身份。</p>\n<h4>如何在网上下单购买，怎么一个操作流程呢？</h4><p>答：这种方式和您逛商场的方式十分相似，您只要按照我们的商品分类页面或进入\"钻石珠宝\"、\"个性定制\"等逐页按照链接指明的路径浏览就可以了。 一旦看中了您喜欢的商品，您可以随时点击\"放入购物篮\"按钮将它放入\"购物篮\"。随后，您可以按\"去收银台\"。我们的商品十分丰富，不过您别担心，我们在每一页中都设立了详细明白的导航条，您是不会迷路的。</p>\n</div></div>', '', '', '', 's:0:\"\";', 's:0:\"\";', '1668', null);
INSERT INTO `sdb_content_article_bodys` VALUES ('26', '43', 'article-help.html', '<div style=\"background-color: rgb(255, 255, 255); padding-top: 0px; padding-right: 0px; padding-bottom: 0px; padding-left: 0px; margin-top: 0px; margin-right: 0px; margin-bottom: 0px; margin-left: 0px; cursor: text; width: 100%; height: 100%; overflow-x: auto; overflow-y: auto; font-family: Arial, Verdana, sans-serif; font-size: 12px; \"><div class=\"pageWrap\"><h2>免责条款</h2><h4>免责声明</h4>如因不可抗力或其他无法控制的原因造成网站销售系统崩溃或无法正常使用，从而导致网上交易无法完成或丢失有关的信息、记录等，网站将不承担责任。但是我们将会尽合理的可能协助处理善后事宜，并努力使客户减少可能遭受的经济损失。<br/>本店可以按买方的要求代办相关运输手续，但我们的责任义务仅限于按时发货，遇到物流（邮政）意外时协助买方查询，不承担任何物流（邮政）提供给顾客之外的赔偿，一切查询索赔事宜均按照物流（邮政）的规定办理。在物流（邮政）全程查询期限未满之前，买方不得要求赔偿。提醒买方一定核实好收货详细地址和收货人电话，以免耽误投递。凡在本店购物，均视为如同意此声明。<br/><h4>客户监督</h4>我们希望通过不懈努力，为客户提供最佳服务，我们在给客户提供服务的全程中接受客户的监督。<h4>争议处理</h4>如果客户与网站之间发生任何争议，可依据当时双方所认定的协议或相关法律来解决。</div></div>', '', '', '', 's:0:\"\";', 's:0:\"\";', '1544', null);
INSERT INTO `sdb_content_article_bodys` VALUES ('27', '44', 'article-help.html', '<div style=\"background-color: rgb(255, 255, 255); padding-top: 0px; padding-right: 0px; padding-bottom: 0px; padding-left: 0px; margin-top: 0px; margin-right: 0px; margin-bottom: 0px; margin-left: 0px; cursor: text; width: 100%; height: 100%; overflow-x: auto; overflow-y: auto; font-family: Arial, Verdana, sans-serif; font-size: 12px; \"><div class=\"pageWrap\"><h2>网站使用条款</h2>如果您在本网站访问或购物，您便接受了以下条件。<h4>版权</h4>本网站上的所有内容诸如文字、图表、标识、按钮图标、图像、声音文件片段、数字下载、数据编辑和软件都是本网站提供者的财产，受中国和国际版权法的保护。本网站上所有内容的汇编是本网站的排他财产，受中国和国际版权法的保护。本网站上所使用的所有软件都是本网站或其关联公司或其软件供应商的财产，受中国和国际版权法的保护。<h4>许可和网站进入</h4>本网站授予您有限的许可进入和个人使用本网站，未经本网站的明确书面同意不许下载（除了页面缓存）或修改网站或其任何部分。这一许可不包括对本网站或其内容的转售或商业利用、任何收集和利用产品目录、说明和价格、任何对本网站或其内容的衍生利用、任何为其他商业利益而下载或拷贝账户信息或使用任何数据采集、 robots或类似的数据收集和摘录工具。未经本网站的书面许可，严禁对本网站的内容进行系统获取以直接或间接创建或编辑文集、汇编、数据库或人名地址录（无论是否通过robots、spiders、自动仪器或手工操作）。另外，严禁为任何未经本使用条件明确允许的目的而使用本网站上的内容和材料。 未经本网站明确书面同意，不得以任何商业目的对本网站或其任何部分进行复制、复印、仿造、出售、转售、访问、或以其他方式加以利用。未经本网站明确书面同意，您不得用设计或运用设计技巧把本网站或其关联公司的商标、标识或其他专有信息（包括图像、文字、网页设计或形式）据为己有。未经本网站明确书面同意，您不可以meta tags或任何其他“隐藏文本”方式使用本网站的名字和商标。任何未经授权的使用都会终止本网站所授予的允许或许可。您被授予有限的、可撤销的和非独家的权利建立链接到本网站主页的超链接，只要这个链接不以虚假、误导、贬毁或其他侵犯性方式描写本网站、其关联公司或它们的产品和服务。<h4>评论、意见、消息和其他内容</h4>访问者可以张贴评论、意见及其他内容，以及提出建议、主意、意见、问题或其他信息，只要内容不是非法、淫秽、威胁、诽谤、侵犯隐私、侵犯知识产权或以其他形式对第三者构成伤害或侵犯或令公众讨厌，也不包含软件病毒、政治宣传、商业招揽、连锁信、大宗邮件或任何形式的“垃圾邮件”。您不可以使用虚假的电子邮件地址、冒充任何他人或实体或以其它方式对卡片或其他内容的来源进行误导。本网站保留清除或编辑这些内容的权利（但非义务），但不对所张贴的内容进行经常性的审查。如果您确实张贴了内容或提交了材料，除非我们有相反指示，您授予本网站及其关联公司非排他的、免费的、永久的、不可撤销的和完全的再许可权而在全世界范围内任何媒体上使用、复制、修改、改写、出版、翻译、创作衍生作品、分发和展示这样的内容。您授予本网站及其关联公司和被转许可人使用您所提交的与这些内容有关的名字的权利，如果他们选择这样做的话。您声明并担保您拥有或以其它方式控制您所张贴内容的权利，内容是准确的，对您所提供内容的使用不违反本政策并不会对任何人和实体造成伤害。您声明并保证对于因您所提供的内容引起的对本网站或其关联公司损害进行赔偿。本网站有权监控和编辑或清除任何活动或内容。本网站对您或任何第三方所张贴的内容不承担责任。<h4>产品说明</h4>本网站及其关联公司努力使产品说明尽可能准确。不过，由于实际条件限制，本网站并不保证产品说明或本网站上的其他内容是准确的、完整的、可靠的、最新的或无任何错误的。<h4>电子通讯</h4>当您访问本网站或给我们发送电子邮件时，您与我们用电子方式进行联系。您同意以电子方式接受我们的信息。我们将用电子邮件或通过在本网站上发布通知的方式与您进行联系。您同意我们用电子方式提供给您的所有协议、通知、披露和其他信息是符合此类通讯必须是书面形式的法定要求的。如果并且当本网站能够证明以电子形式的信息已经发送给您或者在本网站张贴这样的通知，将被视为您已收到所有协议、声明、披露和其他信息。</div></div>', '', '', '', 's:0:\"\";', 's:0:\"\";', '5140', null);
INSERT INTO `sdb_content_article_bodys` VALUES ('28', '45', 'article-help.html', '<div style=\"background-color: rgb(255, 255, 255); padding-top: 0px; padding-right: 0px; padding-bottom: 0px; padding-left: 0px; margin-top: 0px; margin-right: 0px; margin-bottom: 0px; margin-left: 0px; cursor: text; width: 100%; height: 100%; overflow-x: auto; overflow-y: auto; font-family: Arial, Verdana, sans-serif; font-size: 12px; \"><div class=\"pageWrap\"><h2>体贴的售后服务</h2>本网站所售产品均实行三包政策，请顾客保存好有效凭证，以确保我们为您更好服务。本公司的客户除享受国家规定“三包”。您可以更放心地在这里购物。<br/><h3>保修细则</h3><h4>一、在本网站购买的商品，自购买日起(以到货登记为准)7日内出现性能故障，您可以选择退货、换货或修理。</h4><ol>\n	<li>在接到您的产品后，我公司将问题商品送厂商特约维修中心检测；</li>\n	<li>检测报出来后，如非人为损坏的，是产品本身质量问题，我公司会及时按您的要求予以退款、换可或维修。</li>\n	<li>如果检测结果是无故障或是人为因素造成的故障，我公司会及时通知您，并咨询您的处理意见。</li>\n</ol>\n<h4>二、在本公司购买的商品，自购日起(以到货登记为准)15日内出现性能故障，您可以选择换货或修理。(享受15天退换货无需理由的商品，按《15天退换货无需理由细则》办理)</h4><ol>\n	<li>在接到您的产品后，我公司将问题商品送厂商特约维修中心检测；</li>\n	<li>检测报出来后，如非人为损坏的，是产品本身质量问题，我公司会及时按您的要求予以退款、换可或维修。</li>\n	<li>如果检测结果是无故障或是人为因素造成的故障，我公司会及时通知您，并咨询您的处理意见。</li>\n</ol>\n<h4>三、在本公司购买的商品，自购日起(以到货登记为准)一年之内出现非人为损坏的质量问题，本公司承诺免费保修。</h4><ol>\n	<li>在接到您的产品后，我公司将问题商品送厂商特约维修中心检测；</li>\n	<li>检测报出来后，如非人为损坏的，是产品本身质量问题，我公司会及时按您的要求予以退款、换可或维修。</li>\n	<li>如果检测结果是无故障或是人为因素造成的故障，我公司会及时通知您，并咨询您的处理意见。</li>\n</ol>\n<h3>收费维修：</h3><h4>一、对于人为造成的故障，本公司将采取收费维修，包括：</h4><ol>\n	<li>产品内部被私自拆开或其中任何部分被更替；</li>\n	<li>商品里面的条码不清楚，无法成功判断；</li>\n	<li>有入水、碎裂、损毁或有腐蚀等现象；</li>\n	<li>过了保修期的商品。</li>\n</ol>\n<h4>二、符合以下条件，可以要求换货：</h4><ol>\n	<li>客户在收到货物时当面在送货员面前拆包检查，发现货物有质量问题的</li>\n	<li>实际收到货物与网站上描述的有很大的出入的</li>\n	<li>换货流程：客户当面要求送货人员退回货物，然后与我们联系。我们会在一个工作日内为您重新发货，货物到达时间顺延。</li>\n</ol>\n<h4>三、符合以下条件，可以要求退货：</h4>客户收到货物后两天之内，<ol>\n	<li>发现商品有明显的制造缺陷的</li>\n	<li>货物经过一次换货但仍然存在质量问题的</li>\n	<li>由于人为原因造成超过我们承诺到货之日三天还没收到货物的</li>\n</ol>\n退货流程：客户在收到货物后两天内与我们联系，我们会在两个工作日内通过银行汇款把您的货款退回。<h4>在以下情况我们有权拒绝客户的退换货要求：</h4><ol>\n	<li>货物出现破损，但没有在收货时当场要求送货人员换货的</li>\n	<li>超过退换货期限的退换货要求</li>\n	<li>退换货物不全或者外观受损</li>\n	<li>客户发货单据丢失或者不全</li>\n	<li>产品并非我们提供</li>\n	<li>货物本身不存在质量问题的</li>\n</ol>\n</div></div>', '', '', '', 's:0:\"\";', 's:0:\"\";', '3994', null);
INSERT INTO `sdb_content_article_bodys` VALUES ('29', '46', 'article-help.html', '<div style=\"background-color: rgb(255, 255, 255); padding-top: 0px; padding-right: 0px; padding-bottom: 0px; padding-left: 0px; margin-top: 0px; margin-right: 0px; margin-bottom: 0px; margin-left: 0px; cursor: text; width: 100%; height: 100%; overflow-x: auto; overflow-y: auto; font-family: Arial, Verdana, sans-serif; font-size: 12px; \"><div class=\"pageWrap\"><h2>非会员购物通道</h2><ol>\n	<li>我们提供非会员购物功能，在购物车下一步的时候，进入非会员购物通道即可使用此功能。</li>\n	<li>但是由于非会员无法享受购物积分、无法查询订单等，所以我们建议您花一分钟时间注册成为会员，这样就能享受整个网站强大的会员功能和多种优惠措施。</li>\n</ol>\n</div></div>', '', '', '', 's:0:\"\";', 's:0:\"\";', '763', null);
INSERT INTO `sdb_content_article_bodys` VALUES ('30', '47', 'article-help.html', '<div style=\"background-color: rgb(255, 255, 255); padding-top: 0px; padding-right: 0px; padding-bottom: 0px; padding-left: 0px; margin-top: 0px; margin-right: 0px; margin-bottom: 0px; margin-left: 0px; cursor: text; width: 100%; height: 100%; overflow-x: auto; overflow-y: auto; font-family: Arial, Verdana, sans-serif; font-size: 12px; \"><div class=\"pageWrap\"><h2>商品退货保障</h2><h4>符合以下条件，可以要求换货</h4><ol>\n	<li>客户在收到货物时当面在送货员面前拆包检查，发现货物有质量问题的；</li>\n	<li>实际收到货物与网站上描述的有很大的出入的。</li>\n</ol>\n<strong>换货流程</strong>：客户当面要求送货人员退回货物，然后与我们联系。我们会为您重新发货，货物到达时间顺延。<h4>符合以下条件，可以要求退货</h4><ol>\n	<li>客户收到货物后两天之内，发现商品有明显的制造缺陷的；</li>\n	<li>货物经过一次换货但仍然存在质量问题的；</li>\n	<li>由于人为原因造成超过我们承诺到货之日5天还没收到货物的。</li>\n</ol>\n<strong>退货流程：</strong>客户在收到货物后两天内与我们联系，我们会在三个工作日内通过银行汇款把您的货款退回。<h4>在以下情况我们有权拒绝客户的退换货要求</h4><ol>\n	<li>货物出现破损，但没有在收货时当场要求送货人员换货的；</li>\n	<li>超过退换货期限的退换货要求；</li>\n	<li>退换货物不全或者外观受损 ；</li>\n	<li>客户发货单据丢失或者不全；</li>\n	<li>产品并非我们提供；</li>\n	<li>货物本身不存在质量问题的 。</li>\n</ol>\n</div></div>', '', '', '', 's:0:\"\";', 's:0:\"\";', '1671', null);
INSERT INTO `sdb_content_article_bodys` VALUES ('31', '48', 'article-help.html', '<div style=\"background-color: rgb(255, 255, 255); padding-top: 0px; padding-right: 0px; padding-bottom: 0px; padding-left: 0px; margin-top: 0px; margin-right: 0px; margin-bottom: 0px; margin-left: 0px; cursor: text; width: 100%; height: 100%; overflow-x: auto; overflow-y: auto; font-family: Arial, Verdana, sans-serif; font-size: 12px; \"><div class=\"pageWrap\"><h2>积分奖励计划</h2><h4>积分增加</h4>按照订单中商品金额或者商品可得积分，订单状态为已发货后可获得相应的积分 。<h4>积分查询</h4>会员可进入会员中心－会员信息中查看自己的积分情况。<h4>积分有效期</h4>积分长期有效。除非本网站取消积分奖励计划。如果取消积分奖励计划我们会提前通知广大用户。<h4>积分说明</h4>本积分奖励计划由本网站制定并保留所有的解释权和修改权。修改以网站公布为准，不做另行通知。</div></div>', '', '', '', 's:0:\"\";', 's:0:\"\";', '932', null);
