INSERT INTO `sdb_content_article_bodys` VALUES ('44', '61', '0', '<div class=\"pageWrap\">\n<p><font size=\"5\"><strong>如何增强账户安全？</strong></font></p>\n<p><font size=\"2\">您可以登录深商账<span style=\"text-decoration: underline;\"><strong><font size=\"4\">户， 在“我的深商-账户信息-账户安全</font></strong></span>”里，通过经常性修改密码、绑定账户到邮箱和手机、设置支付密码的方式增加账户安全系数，保证账户安全。</font></p>\n<p><font size=\"5\"><strong>密码设置技巧有哪些？</strong></font></p>\n<p><font size=\"2\">为了您的账户安全，在设置密码时，请参考以下建议：</font></p>\n<p><font size=\"2\">一、密码由6-20位字符组成（字母区分大小写）。</font></p>\n<p><font size=\"2\">二、请使用数字、字母或符号的组合，如：gklfd_157、89712am%&amp;等。</font></p>\n<p><font size=\"2\">三、如果设置如下安全性较低的密码，系统会提醒您修改密码以保证安全性：</font></p>\n<p><font size=\"2\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; &nbsp;1、全部由数字组成；</font></p>\n<p><font size=\"2\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;2、全部由字母组成；</font></p>\n<p><font size=\"2\">&nbsp;&nbsp;&nbsp;&nbsp; &nbsp;&nbsp; 3、全部由同一字符组成；</font></p>\n<p><font size=\"2\">&nbsp;&nbsp;&nbsp;&nbsp; &nbsp;&nbsp; 4、与用户名或邮箱相同。</font></p>\n<p><font size=\"2\">四、定期修改密码，并做好记录工作，以免忘记。</font></p>\n<p><font size=\"2\">五、不要将支付密码和登录密码设置为同一密码。</font></p>\n</div>', '', '', '', 's:0:\"\";', 's:0:\"\";', '1569', '');
INSERT INTO `sdb_content_article_bodys` VALUES ('45', '62', '0', '<P><FONT size=4><STRONG>商品包装是否有保证？</STRONG></FONT></P>\r\n<DIV><FONT size=2>我们所发送商品均由专人进行打包，商品在未签收前都由我们负责，如在收到商品时发现包装有破损或是其它方面问题，请直接致电客服热线，客服人员会帮您解决。</FONT></DIV>', '', '', '', 's:0:\"\";', 's:0:\"\";', '326', '');
