INSERT INTO `sdb_site_widgets_instance` VALUES ('28', 'content:1', '0', null, 'usercustom', 'b2c', '', '5', null, null, 'borders/1pxGrayBorder.html', null, 'default.html', 'a:1:{s:10:\"usercustom\";s:2684:\"<br/><div class=\"pageWrap\"><br/> <h2>顾客必读</h2><h4>如何订购商品？</h4>您可以首先浏览我们的网站了解商品。看到您满意的商品您可以直接在我们的网站上实现订购。您也可以和我们网站的客服人员联系订购。<h4>我通过网站看到你们的商品后觉得不错，但是我不是经常上网，你可以寄一些商品的图片和介绍给我吗？</h4>答：我们的网站会不定期地为会员发送商品信息资料的电子邮件。如果您目前还没有成为我们的会员，您可以直接在我们的网站上注册，非常方便。<h4>请告诉我在这里购物的理由好吗？</h4><ol><li>我们是一家拥有长期经营零售业务经验的网站；</li><li>我们将给您带来优质的商品及更优惠的价格；</li><li>多种付款方式以及快速的全国配送；</li><li>人性化的退换货事宜；</li><li>体贴入微的会员积分计划；</li><li>所有产品为原厂正规包装；</li></ol><h4>你们的商品我都非常喜欢，已经购买了很多，但是有些怎么一直没货？会不会订不到？</h4>由于网站顾客购买量比较大，商品随时可能断货，您可以通过网站上的“到货通知”按钮预定商品或直接联系我们的网站客服进行预约订购。<h4>所有的产品都能够在网站上购买?</h4>答：目前网站查找的都是可以订购的，但是必须是仓库中有库存的产品我们才可以与您确认。部分热销产品也可以通过我们的网站做一个预约，等到货品到后，我们会立即通过电话或者电子邮件的方式通知您来订购。<h4>为什么要注册会员？</h4><ol><li>只有注册用户才可以在网上进行订购，享受优惠的价格。</li><li>只有注册用户才可以登录\"会员中心\"，使用更多的会员购物功能,管理自己的资料。</li><li>只有注册用户才可以在网上给其他注册的朋友留言。</li><li>只有注册用户才有可能获取我们赠送的礼品。</li></ol><h4>忘记了密码怎么办？</h4>为了保护客户利益，我们无法看到您的密码。当您忘记密码时，请登录注册页面，点击\"忘记密码\"，系统会自动将您的密码通过email告诉您，您可以登录\"会员中心\"去更改密码，以确保您的利益。<h4>积分是怎么回事？有什么作用？</h4> 积分的高低只反映您对我们的关注和支持程度。我们的积分是通过订购商品产生的。对于高积分的客户我们会有一定的奖励，如积分兑换商品、积分抵扣价格、赠送商品,更优惠的价格购买商品等，以此回馈广大顾客。 <br/></div><br/>\";}', null);
INSERT INTO `sdb_site_widgets_instance` VALUES ('29', 'content:2', '0', null, 'usercustom', 'b2c', '', '5', null, null, 'borders/1pxGrayBorder.html', null, 'default.html', 'a:1:{s:10:\"usercustom\";s:349:\"<br/><div class=\"pageWrap\"><br/> <h2>会员等级折扣</h2> 我们的会员等级系统是动态的，按照会员积分的多少划分不同的等级，等级越高享受的商品折扣越大。 针对会员的促销活动和优惠政策会运用到每一个优惠活动中。如：“捆绑销售”、“积分换购”等等。 <br/></div><br/>\";}', null);
INSERT INTO `sdb_site_widgets_instance` VALUES ('30', 'content:3', '0', null, 'usercustom', 'b2c', '', '5', null, null, 'borders/1pxGrayBorder.html', null, 'default.html', 'a:1:{s:10:\"usercustom\";s:2599:\"<br/><div class=\"pageWrap\"><br/> <h2>订单的几种状态</h2><table class=\"liststyle data\" border=\"0\" cellpadding=\"0\" cellspacing=\"2\"><col class=\"span-4 ColColorGray\"><col class=\"span-6\"><col class=\"span-6\"><col><thead><tr><th>状态名称</th><th>状态释义</th><th>定义</th><th>反馈信息</th></tr></thead><tbody><tr><th>确认</th><td>未确认</td><td>未审核确认订单</td><td>&nbsp;</td></tr><tr><th>已确认</th><td>货到付款订单已经审核确认</td><td>为您发送订单已确认信件</td><td>&nbsp;</td></tr><tr><th>付款</th><td>&nbsp;</td><td>&nbsp;</td><td>&nbsp;</td></tr><tr><th>部分付款</th><td>只收到部分订单货款</td><td>为您发送订单收款信件</td><td>&nbsp;</td></tr><tr><th>已付款</th><td>货款全部收到</td><td>为您发送订单收款信件</td><td>&nbsp;</td></tr><tr><th>取消</th><td>客户要求取消</td><td>客户自行取消的订单</td><td>为您发送订单取消信件</td></tr><tr><th>超送货范围取消</th><td>超出送货范围的订单</td><td>为您发送订单取消信件</td><td>&nbsp;</td></tr><tr><th>重复订单取消</th><td>同一日重复定购同样商品的订单</td><td>为您发送订单取消信件</td><td>&nbsp;</td></tr><tr><th>地址不详取消</th><td>客户所留地址不够详细，或只留信箱，无法上门送货的订单</td><td>为您发送订单取消信件</td><td>&nbsp;</td></tr><tr><th>货款逾期未收到</th><td>自订单日期后7日内仍然没有收到全部货款</td><td>为您发送订单取消信件</td><td>&nbsp;</td></tr><tr><th>货款不足取消</th><td>部分到款后7日内余款未付</td><td>为您发送订单取消信件</td><td>&nbsp;</td></tr><tr><th>发货</th><td>部分发货</td><td>由于订单中部分商品缺货，先将有库存的商品发货</td><td>&nbsp;为您发送全部发货信件</td></tr><tr><th>已发货</th><td>全部发货</td><td>为您发送部分发货信件</td><td>&nbsp;</td></tr><tr><th>退款</th><td>&nbsp;</td><td>&nbsp;</td><td>&nbsp;</td></tr><tr><th>部分退款</th><td>退回您的部分购物款项</td><td>&nbsp;</td><td>&nbsp;</td></tr><tr><th>全额退款</th><td>退回您的全部购物款项</td><td>&nbsp;</td><td>&nbsp;</td></tr><tr><th>退货</th><td>部分退货</td><td>收到了您退回订单中的部分商品</td><td>&nbsp;</td></tr><tr><th>全部退货</th><td>收到了您退回订单中的全部商品</td><td>&nbsp;</td><td>&nbsp;</td></tr><tr><th>归档</th><td>已归档</td><td>订单已经全部处理结束，归档保存</td><td>&nbsp;</td></tr></tbody></table> <br/></div><br/>\";}', null);
INSERT INTO `sdb_site_widgets_instance` VALUES ('31', 'content:4', '0', null, 'usercustom', 'b2c', '', '5', null, null, 'borders/1pxGrayBorder.html', null, 'default.html', 'a:1:{s:10:\"usercustom\";s:605:\"<div class=\"pageWrap\"><br/> <h2>积分奖励计划</h2><h4>积分增加</h4>按照订单中商品金额或者商品可得积分，订单状态为已发货后可获得相应的积分 。<h4>积分查询</h4>会员可进入会员中心－会员信息中查看自己的积分情况。<h4>积分有效期</h4>积分长期有效。除非本网站取消积分奖励计划。如果取消积分奖励计划我们会提前通知广大用户。<h4>积分说明</h4> 本积分奖励计划由本网站制定并保留所有的解释权和修改权。修改以网站公布为准，不做另行通知。 <br/></div><br/>\";}', null);
INSERT INTO `sdb_site_widgets_instance` VALUES ('32', 'content:5', '0', null, 'usercustom', 'b2c', '', '5', null, null, 'borders/1pxGrayBorder.html', null, 'default.html', 'a:1:{s:10:\"usercustom\";s:1320:\"<br/><div class=\"pageWrap\"><br/> <h2>商品退货保障</h2><h4>符合以下条件，可以要求换货</h4><ol><li>客户在收到货物时当面在送货员面前拆包检查，发现货物有质量问题的；</li><li>实际收到货物与网站上描述的有很大的出入的。</li></ol><strong>换货流程</strong>：客户当面要求送货人员退回货物，然后与我们联系。我们会为您重新发货，货物到达时间顺延。<h4>符合以下条件，可以要求退货</h4><ol><li>客户收到货物后两天之内，发现商品有明显的制造缺陷的；</li><li>货物经过一次换货但仍然存在质量问题的；</li><li>由于人为原因造成超过我们承诺到货之日5天还没收到货物的。</li></ol><strong>退货流程：</strong>客户在收到货物后两天内与我们联系，我们会在三个工作日内通过银行汇款把您的货款退回。<h4>在以下情况我们有权拒绝客户的退换货要求</h4><ol><li>货物出现破损，但没有在收货时当场要求送货人员换货的；</li><li>超过退换货期限的退换货要求；</li><li>退换货物不全或者外观受损 ；</li><li>客户发货单据丢失或者不全；</li><li>产品并非我们提供；</li><li>货物本身不存在质量问题的 。</li></ol> <br/></div><br/>\";}', null);
INSERT INTO `sdb_site_widgets_instance` VALUES ('33', 'content:6', '0', null, 'usercustom', 'b2c', '', '5', null, null, 'borders/1pxGrayBorder.html', null, 'default.html', 'a:1:{s:10:\"usercustom\";s:434:\"<br/><div class=\"pageWrap\"><br/> <h2>非会员购物通道</h2><ol><li>我们提供非会员购物功能，在购物车下一步的时候，进入非会员购物通道即可使用此功能。</li><li>但是由于非会员无法享受购物积分、无法查询订单等，所以我们建议您花一分钟时间注册成为会员，这样就能享受整个网站强大的会员功能和多种优惠措施。</li></ol> <br/></div><br/>\";}', null);
INSERT INTO `sdb_site_widgets_instance` VALUES ('34', 'content:7', '0', null, 'usercustom', 'b2c', '', '5', null, null, 'borders/1pxGrayBorder.html', null, 'default.html', 'a:1:{s:10:\"usercustom\";s:3610:\"<br/><div class=\"pageWrap\"><br/> <h2>体贴的售后服务</h2>本网站所售产品均实行三包政策，请顾客保存好有效凭证，以确保我们为您更好服务。本公司的客户除享受国家规定“三包”。您可以更放心地在这里购物。<br><br><h3>保修细则</h3><h4>一、在本网站购买的商品，自购买日起(以到货登记为准)7日内出现性能故障，您可以选择退货、换货或修理。</h4><ol><li>在接到您的产品后，我公司将问题商品送厂商特约维修中心检测；</li><li>检测报出来后，如非人为损坏的，是产品本身质量问题，我公司会及时按您的要求予以退款、换可或维修。</li><li>如果检测结果是无故障或是人为因素造成的故障，我公司会及时通知您，并咨询您的处理意见。</li></ol><h4>二、在本公司购买的商品，自购日起(以到货登记为准)15日内出现性能故障，您可以选择换货或修理。(享受15天退换货无需理由的商品，按《15天退换货无需理由细则》办理)</h4><ol><li>在接到您的产品后，我公司将问题商品送厂商特约维修中心检测；</li><li>检测报出来后，如非人为损坏的，是产品本身质量问题，我公司会及时按您的要求予以退款、换可或维修。</li><li>如果检测结果是无故障或是人为因素造成的故障，我公司会及时通知您，并咨询您的处理意见。</li></ol><h4>三、在本公司购买的商品，自购日起(以到货登记为准)一年之内出现非人为损坏的质量问题，本公司承诺免费保修。</h4><ol><li>在接到您的产品后，我公司将问题商品送厂商特约维修中心检测；</li><li>检测报出来后，如非人为损坏的，是产品本身质量问题，我公司会及时按您的要求予以退款、换可或维修。</li><li>如果检测结果是无故障或是人为因素造成的故障，我公司会及时通知您，并咨询您的处理意见。</li></ol><h3>收费维修：</h3><h4>一、对于人为造成的故障，本公司将采取收费维修，包括：</h4><ol><li>产品内部被私自拆开或其中任何部分被更替；</li><li>商品里面的条码不清楚，无法成功判断；</li><li>有入水、碎裂、损毁或有腐蚀等现象；</li><li>过了保修期的商品。</li></ol><h4>二、符合以下条件，可以要求换货：</h4><ol><li>客户在收到货物时当面在送货员面前拆包检查，发现货物有质量问题的</li><li>实际收到货物与网站上描述的有很大的出入的</li><li>换货流程：客户当面要求送货人员退回货物，然后与我们联系。我们会在一个工作日内为您重新发货，货物到达时间顺延。</li></ol><h4>三、符合以下条件，可以要求退货：</h4>客户收到货物后两天之内，<ol><li>发现商品有明显的制造缺陷的</li><li>货物经过一次换货但仍然存在质量问题的</li><li>由于人为原因造成超过我们承诺到货之日三天还没收到货物的</li></ol>退货流程：客户在收到货物后两天内与我们联系，我们会在两个工作日内通过银行汇款把您的货款退回。<h4>在以下情况我们有权拒绝客户的退换货要求：</h4><ol><li>货物出现破损，但没有在收货时当场要求送货人员换货的</li><li>超过退换货期限的退换货要求</li><li>退换货物不全或者外观受损</li><li>客户发货单据丢失或者不全</li><li>产品并非我们提供</li><li>货物本身不存在质量问题的</li></ol> <br/></div><br/>\";}', null);
INSERT INTO `sdb_site_widgets_instance` VALUES ('35', 'content:8', '0', null, 'usercustom', 'b2c', '', '5', null, null, 'borders/1pxGrayBorder.html', null, 'default.html', 'a:1:{s:10:\"usercustom\";s:4830:\"<br/><div class=\"pageWrap\"><br/> <h2>网站使用条款</h2> 如果您在本网站访问或购物，您便接受了以下条件。 <h4>版权</h4> 本网站上的所有内容诸如文字、图表、标识、按钮图标、图像、声音文件片段、数字下载、数据编辑和软件都是本网站提供者的财产，受中国和国际版权法的保护。本网站上所有内容的汇编是本网站的排他财产，受中国和国际版权法的保护。本网站上所使用的所有软件都是本网站或其关联公司或其软件供应商的财产，受中国和国际版权法的保护。 <h4>许可和网站进入</h4> 本网站授予您有限的许可进入和个人使用本网站，未经本网站的明确书面同意不许下载（除了页面缓存）或修改网站或其任何部分。这一许可不包括对本网站或其内容的转售或商业利用、任何收集和利用产品目录、说明和价格、任何对本网站或其内容的衍生利用、任何为其他商业利益而下载或拷贝账户信息或使用任何数据采集、 robots或类似的数据收集和摘录工具。未经本网站的书面许可，严禁对本网站的内容进行系统获取以直接或间接创建或编辑文集、汇编、数据库或人名地址录（无论是否通过robots、spiders、自动仪器或手工操作）。另外，严禁为任何未经本使用条件明确允许的目的而使用本网站上的内容和材料。 未经本网站明确书面同意，不得以任何商业目的对本网站或其任何部分进行复制、复印、仿造、出售、转售、访问、或以其他方式加以利用。未经本网站明确书面同意，您不得用设计或运用设计技巧把本网站或其关联公司的商标、标识或其他专有信息（包括图像、文字、网页设计或形式）据为己有。未经本网站明确书面同意，您不可以meta tags或任何其他“隐藏文本”方式使用本网站的名字和商标。任何未经授权的使用都会终止本网站所授予的允许或许可。您被授予有限的、可撤销的和非独家的权利建立链接到本网站主页的超链接，只要这个链接不以虚假、误导、贬毁或其他侵犯性方式描写本网站、其关联公司或它们的产品和服务。 <h4>评论、意见、消息和其他内容</h4> 访问者可以张贴评论、意见及其他内容，以及提出建议、主意、意见、问题或其他信息，只要内容不是非法、淫秽、威胁、诽谤、侵犯隐私、侵犯知识产权或以其他形式对第三者构成伤害或侵犯或令公众讨厌，也不包含软件病毒、政治宣传、商业招揽、连锁信、大宗邮件或任何形式的“垃圾邮件”。您不可以使用虚假的电子邮件地址、冒充任何他人或实体或以其它方式对卡片或其他内容的来源进行误导。本网站保留清除或编辑这些内容的权利（但非义务），但不对所张贴的内容进行经常性的审查。如果您确实张贴了内容或提交了材料，除非我们有相反指示，您授予本网站及其关联公司非排他的、免费的、永久的、不可撤销的和完全的再许可权而在全世界范围内任何媒体上使用、复制、修改、改写、出版、翻译、创作衍生作品、分发和展示这样的内容。您授予本网站及其关联公司和被转许可人使用您所提交的与这些内容有关的名字的权利，如果他们选择这样做的话。您声明并担保您拥有或以其它方式控制您所张贴内容的权利，内容是准确的，对您所提供内容的使用不违反本政策并不会对任何人和实体造成伤害。您声明并保证对于因您所提供的内容引起的对本网站或其关联公司损害进行赔偿。本网站有权监控和编辑或清除任何活动或内容。本网站对您或任何第三方所张贴的内容不承担责任。 <h4>产品说明 </h4> 本网站及其关联公司努力使产品说明尽可能准确。不过，由于实际条件限制，本网站并不保证产品说明或本网站上的其他内容是准确的、完整的、可靠的、最新的或无任何错误的。 <h4>电子通讯 </h4> 当您访问本网站或给我们发送电子邮件时，您与我们用电子方式进行联系。您同意以电子方式接受我们的信息。我们将用电子邮件或通过在本网站上发布通知的方式与您进行联系。您同意我们用电子方式提供给您的所有协议、通知、披露和其他信息是符合此类通讯必须是书面形式的法定要求的。如果并且当本网站能够证明以电子形式的信息已经发送给您或者在本网站张贴这样的通知，将被视为您已收到所有协议、声明、披露和其他信息。 <br/></div><br/>\";}', null);
INSERT INTO `sdb_site_widgets_instance` VALUES ('36', 'content:9', '0', null, 'usercustom', 'b2c', '', '5', null, null, 'borders/1pxGrayBorder.html', null, 'default.html', 'a:1:{s:10:\"usercustom\";s:1219:\"<br/><div class=\"pageWrap\"><br/> <h2>免责条款</h2><h4>免责声明</h4>如因不可抗力或其他无法控制的原因造成网站销售系统崩溃或无法正常使用，从而导致网上交易无法完成或丢失有关的信息、记录等，网站将不承担责任。但是我们将会尽合理的可能协助处理善后事宜，并努力使客户减少可能遭受的经济损失。<br>本店可以按买方的要求代办相关运输手续，但我们的责任义务仅限于按时发货，遇到物流（邮政）意外时协助买方查询，不承担任何物流（邮政）提供给顾客之外的赔偿，一切查询索赔事宜均按照物流（邮政）的规定办理。在物流（邮政）全程查询期限未满之前，买方不得要求赔偿。提醒买方一定核实好收货详细地址和收货人电话，以免耽误投递。凡在本店购物，均视为如同意此声明。<br><h4>客户监督</h4>我们希望通过不懈努力，为客户提供最佳服务，我们在给客户提供服务的全程中接受客户的监督。<h4>争议处理</h4>如果客户与网站之间发生任何争议，可依据当时双方所认定的协议或相关法律来解决。 <br/></div><br/>\";}', null);
INSERT INTO `sdb_site_widgets_instance` VALUES ('37', 'content:10', '0', null, 'usercustom', 'b2c', '', '5', null, null, 'borders/1pxGrayBorder.html', null, 'default.html', 'a:1:{s:10:\"usercustom\";s:1414:\"<br/><div class=\"pageWrap\"><br/> <h2>简单的购物流程</h2> <h4>怎样注册？</h4> <br/><p><br/> 答：您可以直接点击\"会员注册\"进行注册。注册很简单，您只需按注册向导的要求输入一些基本信息即可。为了准确地为您服务，请务必在注册时填写您的真实信息，我们会为您保密。输入的帐号要4-10位，仅可使用英文字母、数字\"-\"。 <br/></p><br/> <h4>怎样成为会员?</h4> <br/><p><br/> 答：您可以直接点击\"会员登录与注册\"进行注册。注册很简单，您只需根据系统提示输入相关资料即可，请您填写完毕时，务必核对填写内容的准确性，并谨记您的会员账号和密码，以便您查询订单或是希望网站提供予您更多的服务时用以核对您的身份。 <br/></p><br/> <h4>如何在网上下单购买，怎么一个操作流程呢？</h4> <br/><p><br/> 答：这种方式和您逛商场的方式十分相似，您只要按照我们的商品分类页面或进入\"钻石珠宝\"、\"个性定制\"等逐页按照链接指明的路径浏览就可以了。 一旦看中了您喜欢的商品，您可以随时点击\"放入购物篮\"按钮将它放入\"购物篮\"。随后，您可以按\"去收银台\"。我们的商品十分丰富，不过您别担心，我们在每一页中都设立了详细明白的导航条，您是不会迷路的。 <br/></p><br/> <br/></div><br/>\";}', null);
INSERT INTO `sdb_site_widgets_instance` VALUES ('38', 'content:11', '0', null, 'usercustom', 'b2c', '', '5', null, null, 'borders/1pxGrayBorder.html', null, 'default.html', 'a:1:{s:10:\"usercustom\";s:3484:\"<br/><div class=\"pageWrap\"><br/> <h2>支付方式</h2><table class=\"liststyle data\" border=\"0\" cellpadding=\"0\" cellspacing=\"2\"><colgroup><col class=\"span-4 ColColorGray\"/><col class=\"span-6\"/><col class=\"span-6\"/><col/></colgroup><thead><tr><th width=\"123\">支付方式</th><th width=\"198\">银行</th><th width=\"518\">卡号</th><th width=\"309\">户名</th></tr></thead><tbody><tr><th><span style=\"text-align: left;\">预存款支付</span></th><td>&nbsp;</td><td colspan=\"2\">使用本商店会员预存款余额进行支付。如果余额不足，可进入会员中心在线充值。</td></tr><tr><th><span style=\"text-align: left;\"><label></label></span></th><td><img src=\"http://pic.shopex.cn/pictures/newsimg/1169028039.gif\"></td><td>一卡通卡号：</td><td rowspan=\"2\">刘小恪</td></tr><tr><th>&nbsp;</th><td><strong>招商</strong>银行上海分行</td><td>&nbsp;</td></tr><tr><th>&nbsp;</th><td><font size=\"3\"><strong><img src=\"http://pic.shopex.cn/pictures/newsimg/1169028056.gif\"></strong></font></td><td>灵通卡号：</td><td rowspan=\"2\">刘小恪</td></tr><tr><th>&nbsp;</th><td><font size=\"3\"><strong>工商</strong></font>银行上海分行昌宁支行</td><td><font color=\"#0080c0\">9558</font>8010<font color=\"#0080c0\">0×××8</font>9<font color=\"#0080c0\">×××</font></td></tr><tr><th>&nbsp;</th><td><strong><font size=\"3\"><img src=\"http://pic.shopex.cn/pictures/newsimg/1169028068.gif\"></font></strong></td><td>金穗卡号：</td><td rowspan=\"2\">刘小恪</td></tr><tr><th>&nbsp;</th><td><strong><font size=\"3\">农业</font></strong>银行上海分行共和支行</td><td><font color=\"#0080c0\">622848×××8</font>9<font color=\"#0080c0\">×××</font></td></tr><tr><th>&nbsp;</th><td><font size=\"3\"><strong><img src=\"http://pic.shopex.cn/pictures/newsimg/1169028078.gif\"></strong></font></td><td>龙卡号：</td><td rowspan=\"2\">刘小恪</td></tr><tr><th>&nbsp;</th><td><font size=\"3\"><strong>建设</strong></font>银行上海分行</td><td><font color=\"#0080c0\">4367</font>4212<font color=\"#0080c0\">1×××8<font color=\"#000000\">9</font><font color=\"#0080c0\">×××</font></font></td></tr><tr><th>支付宝</th><td><img alt=\"\" src=\"http://pic.shopex.cn/pictures/newsimg/1169028139.jpg\"></td><td colspan=\"2\">支付宝（<a href=\"http://www.alipay.com/\"><font color=\"#0328c1\">www.alipay.com</font></a>）致力于为中国电子商务提供各种安全、方便、个性化的在线支付解决方案。支付宝从2003年10月在淘宝网推出，短短几年时间内迅速成为使用极其广泛的网上安全支付工具，深受用户喜爱。截止2006年6月，使用支付宝的用户已经超过2000万，日支付宝日交易总额超过４000万元人民币，日交易笔数超过25万笔。</td></tr><tr><th><span style=\"text-align: left;\"><label>paypal贝宝</label></span></th><td><img src=\"http://pic.shopex.cn/pictures/newsimg/1169028114.jpg\"></td><td colspan=\"2\">paypal 贝宝（<a href=\"http://www.paypal.com.cn/\"><font color=\"#000000\">www.paypal.com.cn</font></a>）公司是世界领先的网络支付公司paypal 公司为中国市场度身定做的网络支付服务，可以用e-mail地址，透过信用卡及银行帐户，安全地支付及存入网上各类帐项。paypal公司利用现有的银行系统和信用卡系统，通过先进的网络技术和网络安全防范技术，在全球 103 个国家为超过 1 亿个人以及网上商户提供安全便利的网上支付服务。</td></tr></tbody></table> <br/></div><br/>\";}', null);
INSERT INTO `sdb_site_widgets_instance` VALUES ('39', 'content:12', '0', null, 'usercustom', 'b2c', '', '5', null, null, 'borders/1pxGrayBorder.html', null, 'default.html', 'a:1:{s:10:\"usercustom\";s:2033:\"<br/><div class=\"pageWrap\"><br/> <h2>配送方式</h2><table class=\"liststyle data\" border=\"0\" cellpadding=\"0\" cellspacing=\"2\"><colgroup><col class=\"span-4 ColColorGray\"/><col class=\"span-6\"/><col class=\"span-6\"/><col/></colgroup><thead><tr><th width=\"79\">快递公司</th><th width=\"120\">送货范围</th><th width=\"117\">送达时间</th><th width=\"815\">详细介绍</th></tr></thead><tbody><tr><th><span style=\"text-align: left;\"><label style=\"width: auto;\">顺丰快递(+￥20.00)</label><br><label></label></span></th><td colspan=\"3\"><img src=\"http://pic.shopex.cn/pictures/newsimg/1169028571.jpg\"></td></tr><tr><th>&nbsp;</th><td>全国</td><td>2-4个工作日</td><td>顺丰快递（<a href=\"http://www.sf-express.com/\"><font color=\"#0328c1\">www.sf-express.com</font></a>）可能是国内最好的快递公司。假如你希望快递公司的服务质量比较好，请选择顺丰。从速度到人员素质乃至安全性，顺丰都是国内数一数二的。配送过程中可以进入顺风网站查询和跟踪商品运输情况。</td></tr><tr><th><label style=\"width: auto;\">ems快递(+￥25.00)</label><br></th><td colspan=\"3\"><img src=\"http://pic.shopex.cn/pictures/newsimg/1169028716.jpg\"></td></tr><tr><th>&nbsp;</th><td>全国</td><td>2-5个工作日</td><td>国家邮政特快专递，门对门服务，一般在2-5天内到达。由快递公司中转，所以速度反而会比一般的快递慢。主要用于一般快递无法到达地区。</td></tr><tr><th><label style=\"width: auto;\">fedex联邦快递(+￥30.00)</label><br></th><td colspan=\"3\"><img src=\"http://pic.shopex.cn/pictures/newsimg/1169028674.jpg\"></td></tr><tr><th>&nbsp;</th><td>全国</td><td>1-2工作日</td><td>联邦快递是全球最具规模的快递运输公司，为全球超过220个国家及地区提供快捷、可靠的快递服务。联邦快递设有环球航空及陆运网络，通常只需一至两个工作日，就能迅速运送时限紧迫的货件，而且确保准时送达。</td></tr></tbody></table> <br/></div><br/>\";}', null);
INSERT INTO `sdb_site_widgets_instance` VALUES ('40', 'content:13', '0', null, 'usercustom', 'b2c', '', '5', null, null, 'borders/1pxGrayBorder.html', null, 'default.html', 'a:1:{s:10:\"usercustom\";s:293:\"<br/><div class=\"pageWrap\"><br/> <h2>我的订单何时出库？</h2>订单的出库时间要以您订单的配货情况而定。请您随时登录“会员中心”查看订单状态。如果订单显示“已发货”，说明订单已经出库，请您耐心等待收货。 <br/></div><br/>\";}', null);
INSERT INTO `sdb_site_widgets_instance` VALUES ('41', 'content:14', '0', null, 'usercustom', 'b2c', '', '5', null, null, 'borders/1pxGrayBorder.html', null, 'default.html', 'a:1:{s:10:\"usercustom\";s:2657:\"<br/><div class=\"pageWrap\"><br/> <h2>网上支付小贴士</h2><h4>1、银行卡网上支付的开通手续</h4>因各地银行政策不同，建议您在网上支付前拨打所在地银行电话，咨询该行可供网上支付的银行卡种类及开通手续。<table class=\"liststyle data\" border=\"0\" cellpadding=\"0\" cellspacing=\"2\"><colgroup><col class=\"span-4 ColColorGray\"><col class=\"span-6\"><col class=\"span-6\"><col></colgroup><thead><tr><th width=\"174\"><strong>银行名称</strong></th><th width=\"153\"><strong>服务热线</strong></th><th width=\"195\"><strong>银行名称</strong></th><th width=\"184\"><strong>服务热线</strong></th><th width=\"195\">银行名称</th><th width=\"243\">服务热线</th></tr></thead><tbody><tr><th>招商银行</th><td>95555</td><th>中国银行</th><td>95566</td><th>交通银行</th><td>95559</td></tr><tr><th>中国工商银行</th><td>95588</td><th>北京银行</th><td>010-96169</td><th>光大银行</th><td>95595</td></tr><tr><th>中国建设银行</th><td>95533</td><th>中国农业银行</th><td>95599</td><th>深圳发展银行</th><td>95501</td></tr><tr><th>上海浦东发展银行</th><td>95528</td><th>广东发展银行</th><td>95508</td><th>中国邮政</th><td>11185</td></tr><tr><th>民生银行</th><td>95568</td><th>华夏银行</th><td>95577</td><th>中信银行</th><td>86668888</td></tr></tbody></table><h4>2、支付金额上限</h4>目前各银行对于网上支付均有一定金额的限制，由于各银行政策不同，建议您在申请网上支付功能时向银行咨询相关事宜。<h4>3、怎样判断网上支付是否成功？</h4><ol><li>当您完成网上在线支付过程后，系统应提示支付成功；如果系统没有提示支付失败或成功，您可通过电话、atm 、柜台或登录网上银行等各种方式查询银行卡余额，如果款项已被扣除，网上支付交易应该是成功的，请您耐心等待。</li><li>如果出现信用卡超额透支、存折余额不足、意外断线等导致支付不成功，请您登录会员中心，找到该张未支付成功的订单，重新完成支付。</li></ol><span style=\"color: rgb(255, 0, 0);\">小贴士：请您在48小时之内完成支付，否则我们将不会保留您的订单。</span><h4>4、造成“支付被拒绝”的原因有哪些？</h4><ol><li>所持银行卡尚未开通网上在线支付功能</li><li>所持银行卡已过期、作废、挂失；</li><li>所持银行卡内余额不足；</li><li>输入银行卡卡号或密码不符；</li><li>输入证件号不符；</li><li>银行系统数据传输出现异常；</li><li>网络中断。</li></ol> <br/></div><br/>\";}', null);
INSERT INTO `sdb_site_widgets_instance` VALUES ('42', 'content:15', '0', null, 'usercustom', 'b2c', '', '5', null, null, 'borders/1pxGrayBorder.html', null, 'default.html', 'a:1:{s:10:\"usercustom\";s:1556:\"<br/><div class=\"pageWrap\"><br/> <h2>签收商品时需要注意哪些问题？</h2>1、送货上门、货到付款订单：快递员送货上门时，请您务必当面对照发货单核对商品，如果出现商品数量缺少、商品破损，请您当场办理整单商品的退货。若订单中含有赠品，请一并退回。一旦您确认签字，我们将无法为您办理退换或补发。<ol><strong>特别提示：</strong><li>如果您的订单使用帐户余额或礼券支付，只有退货商品的金额小于实际应付款金额时才可办理。</li><li>如果您的订单中含有赠品，将无法提供此项服务；如果是成套商品，您只能整套退货。如果是捆绑商品，您在退主商品的同时需要将赠品一起退回。</li></ol>2、邮局邮寄订单：请您在领取包裹时务必检查外包装，如果发现包裹破损，请您不要签收，随后请及时将包裹单原件邮寄给我们，您的包裹单原件将作为我们为您办理补发或退款的唯一证明。收到包裹单后，我们将为您办理相关手续。如您未拆开外包装箱，也可以当场全部退货。平邮订单，在收到包裹时，如发现包裹破损，请您要求邮局出具包裹破损证明。<span style=\"color: rgb(255, 0, 0);\">注：敬请您在验货签收时仔细核对发票，如果出现发票开错或漏开，请您及时联系我们，注明订单号、邮寄地址和收信人姓名，我们接到您的信息后会尽快为您开具，并邮寄给您。</span> <br/></div><br/>\";}', null);
INSERT INTO `sdb_site_widgets_instance` VALUES ('43', 'content:16', '0', null, 'usercustom', 'b2c', '', '5', null, null, 'borders/1pxGrayBorder.html', null, 'default.html', 'a:1:{s:10:\"usercustom\";s:7721:\"<br/><p align=\"center\"><br/> <strong>注册服务条款</strong> <br/></p><br/> <br/><p><br/> 尊敬的用户，欢迎您注册成为本网站用户。在注册前请您仔细阅读如下服务条款：<br>本服务协议双方为本网站与本网站用户，本服务协议具有合同效力。<br>您确认本服务协议后，本服务协议即在您和本网站之间产生法律效力。请您务必在注册之前认真阅读全部服务协议内容，如有任何疑问，可向本网站咨询。<br>无论您事实上是否在注册之前认真阅读了本服务协议，只要您点击协议正本下方的\"注册\"按钮并按照本网站注册程序成功注册为用户，您的行为仍然表示您同意并签署了本服务协议。 <br/></p><br/> <h4>1．本网站服务条款的确认和接纳</h4>本网站各项服务的所有权和运作权归本网站拥有。<h4>2．用户必须：</h4>(1)自行配备上网的所需设备， 包括个人电脑、调制解调器或其他必备上网装置。<br>(2)自行负担个人上网所支付的与此服务有关的电话费用、 网络费用。<h4>3．用户在本网站上交易平台上不得发布下列违法信息：</h4>(1)反对宪法所确定的基本原则的；<br>(2).危害国家安全，泄露国家秘密，颠覆国家政权，破坏国家统一的；<br>(3).损害国家荣誉和利益的；<br>(4).煽动民族仇恨、民族歧视，破坏民族团结的；<br>(5).破坏国家宗教政策，宣扬邪教和封建迷信的；<br>(6).散布谣言，扰乱社会秩序，破坏社会稳定的；<br>(7).散布淫秽、色情、赌博、暴力、凶杀、恐怖或者教唆犯罪的；<br>(8).侮辱或者诽谤他人，侵害他人合法权益的；<br>(9).含有法律、行政法规禁止的其他内容的。<h4>4． 有关个人资料</h4>用户同意：<br>(1) 提供及时、详尽及准确的个人资料。<br>(2).同意接收来自本网站的信息。<br>(3) 不断更新注册资料，符合及时、详尽准确的要求。所有原始键入的资料将引用为注册资料。<br>(4)本网站不公开用户的姓名、地址、电子邮箱和笔名，以下情况除外：<br>（a）用户授权本网站透露这些信息。<br>（b）相应的法律及程序要求本网站提供用户的个人资料。如果用户提供的资料包含有不正确的信息，本网站保留结束用户使用本网站信息服务资格的权利。<h4>5. 用户在注册时应当选择稳定性及安全性相对较好的电子邮箱，并且同意接受并阅读本网站发往用户的各类电子邮件。如用户未及时从自己的电子邮箱接受电子邮件或因用户电子邮箱或用户电子邮件接收及阅读程序本身的问题使电子邮件无法正常接收或阅读的，只要本网站成功发送了电子邮件，应当视为用户已经接收到相关的电子邮件。电子邮件在发信服务器上所记录的发出时间视为送达时间。</h4><h4>6． 服务条款的修改</h4>本网站有权在必要时修改服务条款，本网站服务条款一旦发生变动，将会在重要页面上提示修改内容。如果不同意所改动的内容，用户可以主动取消获得的本网站信息服务。如果用户继续享用本网站信息服务，则视为接受服务条款的变动。本网站保留随时修改或中断服务而不需通知用户的权利。本网站行使修改或中断服务的权利，不需对用户或第三方负责。<h4>7． 用户隐私制度</h4>尊重用户个人隐私是本网站的一项基本政策。所以，本网站一定不会在未经合法用户授权时公开、编辑或透露其注册资料及保存在本网站中的非公开内容，除非有法律许可要求或本网站在诚信的基础上认为透露这些信息在以下四种情况是必要的：<br>(1) 遵守有关法律规定，遵从本网站合法服务程序。<br>(2) 保持维护本网站的商标所有权。<br>(3) 在紧急情况下竭力维护用户个人和社会大众的隐私安全。<br>(4)符合其他相关的要求。<br>本网站保留发布会员人口分析资询的权利。<h4>8．用户的帐号、密码和安全性</h4>你一旦注册成功成为用户，你将得到一个密码和帐号。如果你不保管好自己的帐号和密码安全，将负全部责任。另外，每个用户都要对其帐户中的所有活动和事件负全责。你可随时根据指示改变你的密码，也可以结束旧的帐户重开一个新帐户。用户同意若发现任何非法使用用户帐号或安全漏洞的情况，请立即通告本网站。<h4>9． 拒绝提供担保</h4>用户明确同意信息服务的使用由用户个人承担风险。 本网站不担保服务不会受中断，对服务的及时性，安全性，出错发生都不作担保，但会在能力范围内，避免出错。<h4>10．有限责任</h4>本网站对任何直接、间接、偶然、特殊及继起的损害不负责任，这些损害来自：不正当使用本网站服务，或用户传送的信息不符合规定等。这些行为都有可能导致本网站形象受损，所以本网站事先提出这种损害的可能性，同时会尽量避免这种损害的发生。<h4>11．信息的储存及限制</h4>本网站有判定用户的行为是否符合本网站服务条款的要求和精神的权利，如果用户违背本网站服务条款的规定，本网站有权中断其服务的帐号。<h4>12．用户管理</h4><strong>用户必须遵循</strong>：<br>(1) 使用信息服务不作非法用途。<br>(2) 不干扰或混乱网络服务。<br>(3) 遵守所有使用服务的网络协议、规定、程序和惯例。用户的行为准则是以因特网法规，政策、程序和惯例为根据的。<h4>13．保障</h4>用户同意保障和维护本网站全体成员的利益，负责支付由用户使用超出服务范围引起的律师费用，违反服务条款的损害补偿费用，其它人使用用户的电脑、帐号和其它知识产权的追索费。<h4>14．结束服务</h4>用户或本网站可随时根据实际情况中断一项或多项服务。本网站不需对任何个人或第三方负责而随时中断服务。用户若反对任何服务条款的建议或对后来的条款修改有异议，或对本网站服务不满，用户可以行使如下权利：<br>(1) 不再使用本网站信息服务。<br>(2) 通知本网站停止对该用户的服务。<br>结束用户服务后，用户使用本网站服务的权利马上中止。从那时起，用户没有权利，本网站也没有义务传送任何未处理的信息或未完成的服务给用户或第三方。<h4>15．通告</h4>所有发给用户的通告都可通过重要页面的公告或电子邮件或常规的信件传送。服务条款的修改、服务变更、或其它重要事件的通告都会以此形式进行。<h4>16．信息内容的所有权</h4>本网站定义的信息内容包括：文字、软件、声音、相片、录象、图表；在广告中全部内容；本网站为用户提供的其它信息。所有这些内容受版权、商标、标签和其它财产所有权法律的保护。所以，用户只能在本网站和广告商授权下才能使用这些内容，而不能擅自复制、再造这些内容、或创造与内容有关的派生产品。<h4>17．法律</h4>本网站信息服务条款要与中华人民共和国的法律解释一致。用户和本网站一致同意服从本网站所在地有管辖权的法院管辖。如发生本网站服务条款与中华人民共和国法律相抵触时，则这些条款将完全按法律规定重新解释，而其它条款则依旧保持对用户的约束力。 <br/><p><br/> <br/></p><br/>\";}', null);
INSERT INTO `sdb_site_widgets_instance` VALUES ('44', 'content:17', '0', null, 'usercustom', 'b2c', '', '5', null, null, 'borders/1pxGrayBorder.html', null, 'default.html', 'a:1:{s:10:\"usercustom\";s:818:\"<br/><div class=\"pageWrap\"><br/> <h2>隐私条款</h2><h4>个人信息</h4>一般情况下，您无须提供您的姓名或其它个人信息即可访问我们的站点。但有时我们可能需要您提供一些信息，例如为了处理订单、与您联系、提供预订服务或处理工作应聘。我们可能需要这些信息完成以上事务的处理或提供更好的服务。<h4>用途</h4><ol><li>供我们网站交易和沟通等相关方使用，以满足您的订单等购物服务；</li><li>用于与您保持联系，以开展客户满意度调查、市场研究或某些事务的处理；</li><li>用于不记名的数据分析（例如点击流量数据）；</li><li>帮助发展我们的业务关系（如果您是我们网站的业务合作伙伴或批发商）；</li></ol> <br/></div><br/>\";}', null);
INSERT INTO `sdb_site_widgets_instance` VALUES ('45', 'content_node:1', '0', '', 'usercustom', 'b2c', '', '5', '', '1287972909138', '__none__', '', 'default.html', 'a:1:{s:10:\"usercustom\";s:2841:\"<div> \n<img src=\"http://pic.shopex.cn/shop48/welcome.gif\" height=\"130\" width=\"684\"> <br/></div> <h4>简单的购物流程：</h4>\n<img src=\"http://pic.shopex.cn/shop48/003.png\" height=\"51\" width=\"467\"><span class=\"style1\" style=\"font-weight: bold; color: rgb(130, 117, 16);\"></span><h4>如果您需要和我们联系，可以通过以下方式：</h4> <br/><div class=\"division clearfix\"> <br/><div class=\"span-2 textcenter\"> \n<img src=\"http://pic.shopex.cn/shop48/icon_ser.gif\"> <br/></div> <br/><div class=\"span-7\"> <h5>在线客服</h5>点击首页在线客服链接，向客服专员提问。 <br/></div> <br/><div class=\"span-2 textcenter\"> \n<img src=\"http://pic.shopex.cn/shop48/icon_mail.gif\"> <br/></div> <br/><div class=\"span-7\"> <h5>电子邮件</h5>您也可以通过电子邮件和我们联系。 <br/></div> <br/><div class=\"clear\"> <br/></div> <br/><div class=\"span-2 textcenter\"> \n<img src=\"http://pic.shopex.cn/shop48/icon_phone.gif\"> <br/></div> <br/><div class=\"span-7\"> <h5>直播热线</h5>通过电话和我们直接联系。 <br/></div> <br/><div class=\"span-2 textcenter\"> \n<img src=\"http://pic.shopex.cn/shop48/icon_letter.gif\"> <br/></div> <br/><div class=\"span-7\"> <h5>信件</h5>如有必要，可以通过信件方式和我们取得联系。 <br/></div> <br/></div> <br/><span style=\"font-size: 9pt; font-family: 宋体; \"><strong><span style=\"font-size: 10.5pt; font-family: 宋体; color: rgb(255, 153, 0); \">修改本页内容，请到</span><span style=\"font-family: \'Times New Roman\'; font-size: 10.5pt; font-size: 10.5pt;\"></span><font color=\"#FF0000\"><span style=\"font-size: 10.5pt; font-family: 宋体; \">商店管理后台</span><span style=\"font-size: 10.5pt; font-family: \'times new roman\'; \" lang=\"EN-US\"><span style=\"font-size: 10.5pt; font-family: 宋体; \">&gt;&gt;</span>&nbsp;站点<span style=\"font-size: 10.5pt; font-family: \'times new roman\'; \" lang=\"EN-US\"><span style=\"font-size: 10.5pt; font-family: 宋体; \">&gt;&gt;</span>&nbsp;文章栏目</span><span style=\"font-size: 10.5pt; font-family: \'times new roman\'; \" lang=\"EN-US\"><span style=\"font-size: 10.5pt; font-family: 宋体; \">&gt;&gt;</span>&nbsp;</span>帮助中心</span></font><span style=\"font-size: 10.5pt; font-family: \'times new roman\'; \" lang=\"EN-US\"><span style=\"font-family: 宋体; font-weight: normal; font-size: 12px; \"><strong><span lang=\"EN-US\" style=\"font-size: 10.5pt; font-family: \'times new roman\'; \"><span lang=\"EN-US\" style=\"font-size: 10.5pt; font-family: \'times new roman\'; \"><span style=\"font-size: 10.5pt; font-family: 宋体; \"><font color=\"#FF0000\">&gt;&gt;编辑视图</font></span><font color=\"#FF9900\">&nbsp;</font></span></span></strong></span><font color=\"#FF9900\">&nbsp;</font></span><span style=\"font-size: 10.5pt; font-family: 宋体; color: rgb(255, 153, 0); \">进行编辑</span></strong></span>\";}', '1288082216');
INSERT INTO `sdb_site_widgets_instance` VALUES ('46', 'content_node:7', '0', null, 'usercustom', 'b2c', '', '5', null, null, 'borders/1pxGrayBorder.html', null, 'default.html', 'a:1:{s:10:\"usercustom\";s:1930:\"<div class=\"pageWrap\"><br/> <h2>关于我们</h2> <br/> <br/><br/><p><br/> 本商城是新一代专业消费服务网站。我们利用强大的全球化集约采购优势、丰富的电子商务管理服务经验和最先进的互联网技术为您提供最新最好的产品。 <br/></p><br/> <h4>成立源起</h4>在目前广大购物者渐渐对产品性价比要求越来越高的今天，我们发现必须有一套完善的采购经销体系，才能不断的提高产品质量同时降低产品价格，因此减少产品销售中间环节成本的增加势在必行。因此我们创办中国网上购物商城网站，让产品在网站上直接面对消费者，一方面网站可以提供比在商店购物中更为详尽的资料、历史渊源以及顾客评论等信息，顾客可以方便的从琳琅满目的各类商品中快速查询出需要的产品；另一方面也大大的减少商店运营成本，将价格实惠转让给顾客。<h4>定位</h4>本商城所登陆的商品全部是经过我们在千百种产品中精挑细选出的精品，每一件商品都有自己的特色，每件产品在登陆之前都经过网站编辑的层层筛选，这个将是我们自始至终所坚定的服务原则。<h4>承诺</h4> 我们承诺提供权威的资讯、最低的价格和便捷的购物方式，为您打造全新的e时代购物新体验！我们承诺严格按照国家法规政策正规经营，经营的产品皆为正规渠道引进合法缴税的原装正品，有着完善的保修、退货与售后服务制度。为了让您更准确全面的了解您所需要的商品，我们的每一件商品都提供100%实样的高清晰数码照片、详尽的技术性能指标和制造厂商的介绍。同时采用多种便捷的支付方式和安全快速的配送体系，通过先进的互联网技术进行订单的实时跟踪，并保证每一位客户资料的安全与保密。 <br/></div>\";}', null);
INSERT INTO `sdb_site_widgets_instance` VALUES ('47', 'content_node:8', '0', null, 'usercustom', 'b2c', '', '5', null, null, 'borders/1pxGrayBorder.html', null, 'default.html', 'a:1:{s:10:\"usercustom\";s:946:\"<br/><div class=\"pageWrap\"><br/> <h2>联系我们</h2> <br/> <br/><p><br/> 热心细致的服务态度打造温暖亲切的购物氛围。 <br/></p><br/> <table class=\"liststyle data\" border=\"0\" cellpadding=\"0\" cellspacing=\"0\" width=\"100%\"><tbody><tr><th>服务热线：</th><td>021-8****818&nbsp;&nbsp;<span class=\"g\"><font color=\"#666666\">(工作时间竭诚为您服务)<br>热线服务时间：<br>周一～周五 09：00－18：00<br>周六、周日以及公共假期 12：00－17：00</font></span></td></tr><tr><th>电子邮箱：</th><td><a href=\"mailto:storesupport@ourstore.com.cn.net\">storesupport@ourstore.com.cn.net</a></td></tr><tr><th>商店留言：</th><td>您可以点击“商店留言”将您的意见和建议提给我们。</td></tr><tr><th>地&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 址：</th><td>上海市虹桥路***号***室</td></tr><tr><th>邮政编码：</th><td>200020</td></tr></tbody></table> <br/></div><br/>\";}', null);
INSERT INTO `sdb_site_widgets_instance` VALUES ('48', 'content_node:9', '0', null, 'usercustom', 'b2c', '', '5', null, null, 'borders/1pxGrayBorder.html', null, 'default.html', 'a:1:{s:10:\"usercustom\";s:758:\"<br/><div class=\"pageWrap\"><br/> <h2>招聘信息</h2><h4>我的工作！</h4><ul class=\"list\"><li>中国电子商务发展的领跑者；</li><li>面向全世界的网上消费者提供几十个类别共计百万种商品；</li><li>方便超值的网络购物，每天让近千万的网上消费者轻松得到精神和物质上的收获，让你的生活更多愉悦；</li></ul><h4>快来加入！</h4>或许我们曾经陌路，或许我们曾经是对手，但我们可能是更好的工作伙伴。<br>这里将给予你飞翔的天空、畅游的海洋、驰骋的疆土。<br>这里是一个任由你发挥创造的平台！<br>这里所需要的仅仅是你的热忱与才智！<br>诚邀加盟，一起收获！共同愉悦！<br> <br/></div><br/>\";}', null);
