; font-weight: inherit; font-style: inherit; font-size: 12px; font-family: inherit; vertical-align: baseline; list-style-type: none; list-style-position: initial; list-style-image: initial; \"><li style=\"margin-top: 0px; margin-right: 0px; margin-bottom: 0px; margin-left: 20px; padding-top: 0px; padding-right: 0px; padding-bottom: 0px; padding-left: 0px; border-top-width: 0px; border-right-width: 0px; border-bottom-width: 1px; border-left-width: 0px; border-style: initial; border-color: initial; font-weight: inherit; font-style: inherit; font-size: 12px; font-family: inherit; vertical-align: baseline; list-style-type: decimal; list-style-position: initial; list-style-image: initial; color: rgb(102, 102, 102); border-bottom-style: solid; border-bottom-color: rgb(239, 239, 239); line-height: 20px; \">客户在收到货物时当面在送货员面前拆包检查，发现货物有质量问题的；</li><li style=\"margin-top: 0px; margin-right: 0px; margin-bottom: 0px; margin-left: 20px; padding-top: 0px; padding-right: 0px; padding-bottom: 0px; padding-left: 0px; border-top-width: 0px; border-right-width: 0px; border-bottom-width: 1px; border-left-width: 0px; border-style: initial; border-color: initial; font-weight: inherit; font-style: inherit; font-size: 12px; font-family: inherit; vertical-align: baseline; list-style-type: decimal; list-style-position: initial; list-style-image: initial; color: rgb(102, 102, 102); border-bottom-style: solid; border-bottom-color: rgb(239, 239, 239); line-height: 20px; \">实际收到货物与网站上描述的有很大的出入的。</li>\n</ol>\n<strong style=\"font-weight: bold; \">换货流程</strong>：客户当面要求送货人员退回货物，然后与我们联系。我们会为您重新发货，货物到达时间顺延。<h4 style=\"margin-top: 10px; margin-right: 0px; margin-bottom: 10px; margin-left: 0px; padding-top: 0px; padding-right: 0px; padding-bottom: 0px; padding-left: 14px; border-top-width: 0px; border-right-width: 0px; border-bottom-width: 1px; border-left-width: 0px; border-style: initial; border-color: initial; font-weight: bold; font-style: inherit; font-size: 12px; font-family: inherit; vertical-align: baseline; list-style-type: none; list-style-position: initial; list-style-image: initial; color: rgb(17, 17, 17); border-bottom-style: solid; border-bottom-color: rgb(221, 221, 221); background-image: url(http://localhost/485svn/statics/arrowleft-orange.gif); background-attachment: initial; background-origin: initial; background-clip: initial; background-color: initial; background-position: 0px 5px; background-repeat: no-repeat no-repeat; \">符合以下条件，可以要求退货</h4><ol style=\"margin-top: 0px; margin-right: 0px; margin-bottom: 0px; margin-left: 0px; padding-top: 0px; padding-right: 0px; padding-bottom: 0px; padding-left: 0px; border-top-width: 0px; border-right-width: 0px; border-bottom-width: 0px; border-left-width: 0px; border-style: initial; border-color: initial; font-weight: inherit; font-style: inherit; font-size: 12px; font-family: inherit; vertical-align: baseline; list-style-type: none; list-style-position: initial; list-style-image: initial; \"><li style=\"margin-top: 0px; margin-right: 0px; margin-bottom: 0px; margin-left: 20px; padding-top: 0px; padding-right: 0px; padding-bottom: 0px; padding-left: 0px; border-top-width: 0px; border-right-width: 0px; border-bottom-width: 1px; border-left-width: 0px; border-style: initial; border-color: initial; font-weight: inherit; font-style: inherit; font-size: 12px; font-family: inherit; vertical-align: baseline; list-style-type: decimal; list-style-position: initial; list-style-image: initial; color: rgb(102, 102, 102); border-bottom-style: solid; border-bottom-color: rgb(239, 239, 239); line-height: 20px; \">客户收到货物后两天之内，发现商品有明显的制造缺陷的；</li><li style=\"margin-top: 0px; margin-right: 0px; margin-bottom: 0px; margin-left: 20px; padding-top: 0px; padding-right: 0px; padding-bottom: 0px; padding-left: 0px; border-top-width: 0px; border-right-width: 0px; border-bottom-width: 1px; border-left-width: 0px; border-style: initial; border-color: initial; font-weight: inherit; font-style: inherit; font-size: 12px; font-family: inherit; vertical-align: baseline; list-style-type: decimal; list-style-position: initial; list-style-image: initial; color: rgb(102, 102, 102); border-bottom-style: solid; border-bottom-color: rgb(239, 239, 239); line-height: 20px; \">货物经过一次换货但仍然存在质量问题的；</li><li style=\"margin-top: 0px; margin-right: 0px; margin-bottom: 0px; margin-left: 20px; padding-top: 0px; padding-right: 0px; padding-bottom: 0px; padding-left: 0px; border-top-width: 0px; border-right-width: 0px; border-bottom-width: 1px; border-left-width: 0px; border-style: initial; border-color: initial; font-weight: inherit; font-style: inherit; font-size: 12px; font-family: inherit; vertical-align: baseline; list-style-type: decimal; list-style-position: initial; list-style-image: initial; color: rgb(102, 102, 102); border-bottom-style: solid; border-bottom-color: rgb(239, 239, 239); line-height: 20px; \">由于人为原因造成超过我们承诺到货之日5天还没收到货物的。</li>\n</ol>\n<strong style=\"font-weight: bold; \">退货流程：</strong>客户在收到货物后两天内与我们联系，我们会在三个工作日内通过银行汇款把您的货款退回。<h4 style=\"margin-top: 10px; margin-right: 0px; margin-bottom: 10px; margin-left: 0px; padding-top: 0px; padding-right: 0px; padding-bottom: 0px; padding-left: 14px; border-top-width: 0px; border-right-width: 0px; border-bottom-width: 1px; border-left-width: 0px; border-style: initial; border-color: initial; font-weight: bold; font-style: inherit; font-size: 12px; font-family: inherit; vertical-align: baseline; list-style-type: none; list-style-position: initial; list-style-image: initial; color: rgb(17, 17, 17); border-bottom-style: solid; border-bottom-color: rgb(221, 221, 221); background-image: url(http://localhost/485svn/statics/arrowleft-orange.gif); background-attachment: initial; background-origin: initial; background-clip: initial; background-color: initial; background-position: 0px 5px; background-repeat: no-repeat no-repeat; \">在以下情况我们有权拒绝客户的退换货要求</h4><ol style=\"margin-top: 0px; margin-right: 0px; margin-bottom: 0px; margin-left: 0px; padding-top: 0px; padding-right: 0px; padding-bottom: 0px; padding-left: 0px; border-top-width: 0px; border-right-width: 0px; border-bottom-width: 0px; border-left-width: 0px; border-style: initial; border-color: initial; font-weight: inherit; font-style: inherit; font-size: 12px; font-family: inherit; vertical-align: baseline; list-style-type: none; list-style-position: initial; list-style-image: initial; \"><li style=\"margin-top: 0px; margin-right: 0px; margin-bottom: 0px; margin-left: 20px; padding-top: 0px; padding-right: 0px; padding-bottom: 0px; padding-left: 0px; border-top-width: 0px; border-right-width: 0px; border-bottom-width: 1px; border-left-width: 0px; border-style: initial; border-color: initial; font-weight: inherit; font-style: inherit; font-size: 12px; font-family: inherit; vertical-align: baseline; list-style-type: decimal; list-style-position: initial; list-style-image: initial; color: rgb(102, 102, 102); border-bottom-style: solid; border-bottom-color: rgb(239, 239, 239); line-height: 20px; \">货物出现破损，但没有在收货时当场要求送货人员换货的；</li><li style=\"margin-top: 0px; margin-right: 0px; margin-bottom: 0px; margin-left: 20px; padding-top: 0px; padding-right: 0px; padding-bottom: 0px; padding-left: 0px; border-top-width: 0px; border-right-width: 0px; border-bottom-width: 1px; border-left-width: 0px; border-style: initial; border-color: initial; font-weight: inherit; font-style: inherit; font-size: 12px; font-family: inherit; vertical-align: baseline; list-style-type: decimal; list-style-position: initial; list-style-image: initial; color: rgb(102, 102, 102); border-bottom-style: solid; border-bottom-color: rgb(239, 239, 239); line-height: 20px; \">超过退换货期限的退换货要求；</li><li style=\"margin-top: 0px; margin-right: 0px; margin-bottom: 0px; margin-left: 20px; padding-top: 0px; padding-right: 0px; padding-bottom: 0px; padding-left: 0px; border-top-width: 0px; border-right-width: 0px; border-bottom-width: 1px; border-left-width: 0px; border-style: initial; border-color: initial; font-weight: inherit; font-style: inherit; font-size: 12px; font-family: inherit; vertical-align: baseline; list-style-type: decimal; list-style-position: initial; list-style-image: initial; color: rgb(102, 102, 102); border-bottom-style: solid; border-bottom-color: rgb(239, 239, 239); line-height: 20px; \">退换货物不全或者外观受损 ；</li><li style=\"margin-top: 0px; margin-right: 0px; margin-bottom: 0px; margin-left: 20px; padding-top: 0px; padding-right: 0px; padding-bottom: 0px; padding-left: 0px; border-top-width: 0px; border-right-width: 0px; border-bottom-width: 1px; border-left-width: 0px; border-style: initial; border-color: initial; font-weight: inherit; font-style: inherit; font-size: 12px; font-family: inherit; vertical-align: baseline; list-style-type: decimal; list-style-position: initial; list-style-image: initial; color: rgb(102, 102, 102); border-bottom-style: solid; border-bottom-color: rgb(239, 239, 239); line-height: 20px; \">客户发货单据丢失或者不全；</li><li style=\"margin-top: 0px; margin-right: 0px; margin-bottom: 0px; margin-left: 20px; padding-top: 0px; padding-right: 0px; padding-bottom: 0px; padding-left: 0px; border-top-width: 0px; border-right-width: 0px; border-bottom-width: 1px; border-left-width: 0px; border-style: initial; border-color: initial; font-weight: inherit; font-style: inherit; font-size: 12px; font-family: inherit; vertical-align: baseline; list-style-type: decimal; list-style-position: initial; list-style-image: initial; color: rgb(102, 102, 102); border-bottom-style: solid; border-bottom-color: rgb(239, 239, 239); line-height: 20px; \">产品并非我们提供；</li><li style=\"margin-top: 0px; margin-right: 0px; margin-bottom: 0px; margin-left: 20px; padding-top: 0px; padding-right: 0px; padding-bottom: 0px; padding-left: 0px; border-top-width: 0px; border-right-width: 0px; border-bottom-width: 1px; border-left-width: 0px; border-style: initial; border-color: initial; font-weight: inherit; font-style: inherit; font-size: 12px; font-family: inherit; vertical-align: baseline; list-style-type: decimal; list-style-position: initial; list-style-image: initial; color: rgb(102, 102, 102); border-bottom-style: solid; border-bottom-color: rgb(239, 239, 239); line-height: 20px; \">货物本身不存在质量问题的 。</li>\n</ol>\n</span>\";}', '1287974830');
