\"font-family: Arial, Verdana, sans-serif; font-size: 12px; \">本商城是新一代专业消费服务网站。我们利用强大的全球化集约采购优势、丰富的电子商务管理服务经验和最先进的互联网技术为您提供最新最好的产品。</p>\n<h4 style=\"font-family: Arial, Verdana, sans-serif; font-size: 12px; \">成立源起</h4>在目前广大购物者渐渐对产品性价比要求越来越高的今天，我们发现必须有一套完善的采购经销体系，才能不断的提高产品质量同时降低产品价格，因此减少产品销售中间环节成本的增加势在必行。因此我们创办中国网上购物商城网站，让产品在网站上直接面对消费者，一方面网站可以提供比在商店购物中更为详尽的资料、历史渊源以及顾客评论等信息，顾客可以方便的从琳琅满目的各类商品中快速查询出需要的产品；另一方面也大大的减少商店运营成本，将价格实惠转让给顾客。<h4 style=\"font-family: Arial, Verdana, sans-serif; font-size: 12px; \">定位</h4>本商城所登陆的商品全部是经过我们在千百种产品中精挑细选出的精品，每一件商品都有自己的特色，每件产品在登陆之前都经过网站编辑的层层筛选，这个将是我们自始至终所坚定的服务原则。<h4 style=\"font-family: Arial, Verdana, sans-serif; font-size: 12px; \">承诺</h4>我们承诺提供权威的资讯、最低的价格和便捷的购物方式，为您打造全新的e时代购物新体验！我们承诺严格按照国家法规政策正规经营，经营的产品皆为正规渠道引进合法缴税的原装正品，有着完善的保修、退货与售后服务制度。为了让您更准确全面的了解您所需要的商品，我们的每一件商品都提供100%实样的高清晰数码照片、详尽的技术性能指标和制造厂商的介绍。同时采用多种便捷的支付方式和安全快速的配送体系，通过先进的互联网技术进行订单的实时跟踪，并保证每一位客户资料的安全与保密。</div></div>\";}', '1287978753');
